@import url("https://fonts.googleapis.com/css2?family=Poppins:wght@300;400;500;600;700&display=swap");

*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    font-family: 'Poppins',sans-serif;
}

body{
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    background: linear-gradient(to bottom right, rgba(40, 22, 139, 0.884), purple);
}

.box {
    background: #fff;
    /* height: 150px; */
    height: 300px;
    width: 350px;
    border-radius: 8px;
}

.box h1 {
    padding: 20px 30px;
    font-size: 20px;
    font-weight: 600;
}

.task {
    /* background: #000; */
    padding: 0 30px;
    position: relative;
}

.task input {
    width: 85%;
    height: 40px;
    border-radius: 20px;
    border: 2px solid rgba(0,0,0,0.1);
    background: rgba(0,0,0,0.1);
    padding-left: 15px;
}

.task button {
    content: "";
    position: absolute;
    left: 240px;
    height: 40px;
    width: 20%;
    border-radius: 20px;
    background: rgb(255, 106, 0);
    color: #fff;
    border: none;
}

ul li {
    list-style: none;
    font-size: 17px;
    padding: 20px 8px 0 50px;
    user-select: none;
    cursor: pointer;
}

